div.div:
Traffic Flow: Users -> SASE (SWG/ZTNA) -> Firewall -> DC Routers -> F5 (LB) -> Services on RKE2 (via Istio).
Redundancy: All tiers in A/B pairs; multi-cluster Istio with active-active routing;
Harvester manages physical host (HCI)
Rancher manages all rke2 clusters (k8s clusters).
Storage: Longhorn for VM/cluster storage;
External NetApp via iSCSI for persistent volumes.
